import React from 'react';
import './UtenteSolicitacao.css';
import './dropdownMenu.css';

const PacientPageOne = () => {
    return (
      <div className="header-div">
            <img
                src={require("./juntas-logo.png")}
                alt="logo"
                className='img'/> 
              <div class="dropdown">
                <p className="header-content">Solicitação</p><button class="dropbtn">Dropdown</button>
                  <div class="dropdown-content">
                    <a href="">Link 1</a>
                    <a href="">Link 2</a>
                  </div>
              </div>
          
          <img
                src={require("./user.png")}
                alt="logo"
                className='img'/> 
      </div>   
    );
  }
  
export default PacientPageOne;
